script: |
  super -f text -I q5302.spq | sort > q5302.out

inputs:
  - name: q5302.spq
    data: |
      SELECT ALL + - col0 FROM tab1 (FORMAT parquet) WHERE NOT + col2 NOT BETWEEN + ( - - col0 ) * - - ( - col0 ) / col1 + + col2 AND + + 1 * + + col0;
  - name: tab1

outputs:
  - name: q5302.out
    data: |
      -85
      -91
